(def num-particles 10)
(def is-states (take num-particles (infer :importance polynomial-regression [fixed-inputs test-outputs])))
(let [inputs (range -10 10.5 0.5)]
  (compose
    ;; Points
    (list-plot (mapv vector fixed-inputs test-outputs))
    
    ;; Ground truth
    (plot (partial poly [w0 w1 w2]) [-10 10] :color "black")
    
    ;; Posterior
    (apply compose
           (mapv (fn [[[w0 w1 w2] weight]]
                   (plot (partial poly [w0 w1 w2]) [-10 10]
                                :opacity weight
                                :color "blue"
                                :joined true))
                 (vec (empirical-distribution (collect-results is-states)))))))
